import axios from "axios";

export const logEvent = async (attemptId, type) => {
  try {
    const response = await axios.post(
      `http://localhost:5000/api/attempt/${attemptId}/event`,
      {
        events: [
          {
            eventType: type,
            timestamp: new Date().toISOString(),
          },
        ],
      }
    );

    return response.data;
  } catch (error) {
    console.error("Error logging event:", error.response?.data || error.message);
  }
};


export const submitTest = async (attemptId) => {
  try {
    const response = await axios.post(
      `http://localhost:5000/api/attempt/submit/${attemptId}`
    );

    return response.data;
  } catch (error) {
    console.error("Submit failed:", error.response?.data || error.message);
    throw error;
  }
};




export const getAttemptById = async (attemptId) => {
  const response = await axios.get(
    `http://localhost:5000/api/attempt/${attemptId}`
  );

  return response.data;
};
